import axios from 'axios';

const API_BASE_URL = 'http://127.0.0.1:8000/api/doctor/';

export const getDoctorProfile = async (id) => {
  try {
    const response = await axios.get(`${API_BASE_URL}doctor-profiles/${id}/`);
    return response.data;
  } catch (error) {
    console.error('Error fetching profile:', error);
    throw error;
  }
};
